// protobuf.PushNotify.PushNotifyResIdl
syntax = "proto3";
option java_package = "tbclient.PushNotify";
message PushNotifyResIdl {
  message PusherMsg {
    message PusherMsgInfo {
      int64 groupId = 1;
      int64 msgId = 2;
      int32 type = 4;
      string et = 6;
      int32 groupType = 7;
    }
    PusherMsgInfo data = 2;
  }
  repeated PusherMsg multiMsg = 2;
}
